import{_ as t}from"./chunks/cube_yellow_hero.BLIAdqkc.js";import{_ as e,a as l}from"./chunks/cube_ports_usb_sdcard.DjqeRsN_.js";import{_ as r}from"./chunks/cube_ports_debug.rfpatbdm.js";import{_ as i,c as a,o,ab as s}from"./chunks/framework.CUflZczI.js";const M=JSON.parse('{"title":"Контролер польоту CubePilot Cube Yellow","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/cubepilot_cube_yellow.md","filePath":"uk/flight_controller/cubepilot_cube_yellow.md"}'),u={name:"uk/flight_controller/cubepilot_cube_yellow.md"},n=s('<h1 id="контролер-польоту-cubepilot-cube-yellow" tabindex="-1">Контролер польоту CubePilot Cube Yellow <a class="header-anchor" href="#контролер-польоту-cubepilot-cube-yellow" aria-label="Permalink to &quot;Контролер польоту CubePilot Cube Yellow&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який інший) автопілот. Зверніться до <a href="https://cubepilot.org/#/home" target="_blank" rel="noreferrer">виробника</a> щодо підтримки обладнання або питань сумісності.</p></div><p>Контролер польоту Cube Yellow - це гнучкий автопілот, призначений в першу чергу для виробників комерційних систем.</p><p><img src="'+t+'" alt="Cube Yellow"></p><p>Контролер призначений для використання зі специфічною для домену несучою платою, щоб зменшити кількість дротів, підвищити надійність і спростити збірку. Наприклад, несуча плата для комерційного інспекційного автомобіля може містити з&#39;єднання для комп&#39;ютера-компаньйона, тоді як несуча плата для гонщика може містити ESC для рами апарату.</p><p>Cube має віброізоляцію на двох IMU, з третім фіксованим IMU в якості еталонного/резервного.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Документація виробника <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Docs</a> містить детальну інформацію, включаючи огляд <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview#differences-between-cube-colours" target="_blank" rel="noreferrer">Різниця між Cube Colours</a>.</p></div><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li>32bit STM32F777VI (32-бітний <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>, 400 MHz, Flash 2МБ, RAM 512 КБ).</li><li>32-бітний відмовостійкий співпроцесор STM32F103 </li><li>14 ШІМ / серво виходів (8 з відмовостійкими і ручним керуванням, 6 допоміжних, сумісних з великими потужностями)</li><li>Широкі можливості підключення додаткових периферійних пристроїв (UART, I2C, CAN)</li><li>Інтегрована система резервного копіювання для відновлення в польоті та ручного керування з виділеним процесором та автономним джерелом живлення (для літаків з фіксованим крилом)</li><li>Резервна система інтегрує систему мікшування, забезпечуючи узгоджені режими автопілота та ручного заміщення ( для літаків з фіксованим крилом)</li><li>Резервні входи живлення та автоматичне перемикання на резервне джерело</li><li>Зовнішній запобіжний вимикач</li><li>Головний візуальний індикатор - багатоколірний світлодіод</li><li>Потужний багатотональний п&#39;єзозвуковий індикатор</li><li>карта microSD для високошвидкісної фіксації даних протягом тривалого періоду часу</li></ul><p><a id="stores"></a></p><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://www.cubepilot.com/#/reseller/list" target="_blank" rel="noreferrer">Список реселерів</a></li></ul><h2 id="монтаж" tabindex="-1">Монтаж <a class="header-anchor" href="#монтаж" aria-label="Permalink to &quot;Монтаж&quot;">​</a></h2><p><a href="./../assembly/quick_start_cube.html">Cube Wiring Quickstart</a></p><h2 id="специфікаціі" tabindex="-1">Специфікації <a class="header-anchor" href="#специфікаціі" aria-label="Permalink to &quot;Специфікації&quot;">​</a></h2><ul><li><strong>Процесор:</strong><ul><li>STM32F777VI (32-бітний <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>)</li><li>400 МГц</li><li>512 KB MB RAM</li><li>2 MB Flash</li></ul></li><li><strong>Відмовостійкий співпроцесор:</strong><ul><li>STM32F100 (32біт <em>ARM Cortex-M3</em>)</li><li>24 МГц</li><li>8 KB SRAM</li></ul></li><li><strong>Датчики:</strong> (всі підключені через SPI) <ul><li><strong>Акселерометр:</strong> (3) ICM20948, ICM20649, ICM20602</li><li><strong>Гіроскоп:</strong> (3) ICM20948, ICM20649, ICM20602</li><li><strong>Компас:</strong> (1) ICM20948</li><li><strong>Барометричний датчик тиску:</strong> (2) MS5611</li></ul></li><li><strong>Умови експлуатації:</strong><ul><li><strong>Робоча температура:</strong> від -10C до 55C</li><li><strong>Степень захисту IP/Водонепроникність:</strong> Не водонепроникний</li><li><strong>Вхідна напруга серворейки:</strong> 3,3В / 5В</li><li><strong>Вхід USB-порту:</strong><ul><li>Напруга: 4В - 5.7В</li><li>Номінальний струм: 250 мА</li></ul></li><li><strong>POWER:</strong><ul><li>Вхідна напруга: 4.1В - 5.7В</li><li>Номінальний вхідний струм: 2,5 А</li><li>Номінальна вхідна/вихідна потужність: 14 Вт</li></ul></li></ul></li><li><strong>Розміри:</strong><ul><li><strong>Cube:</strong> 38.25 мм x 38.25 мм x 22.3 мм</li><li><strong>Carrier:</strong> 94,5 мм x 44,3 мм x 17,3 мм</li></ul></li><li><strong>Інтерфейси</strong><ul><li>Порти вводу-виводу: 14 ШІМ-виходів сервоприводів (8 від IO, 6 від FMU)</li><li>5x UART (послідовні порти), один високої потужності, 2x з контролем потоку ГВП</li><li>2x CAN (один з внутрішнім 3.3V трансивером, один на конекторі розширювача)</li><li><strong>Входи ПДУ (пульт дистанційного управління):</strong><ul><li>Spektrum DSM / DSM2 / DSM-X® Satellite compatible вхід</li><li>Futaba S.BUS® вхід і вихід</li><li>Вхід сигналу PPM-SUM</li></ul></li><li>Вхід RSSI (ШІМ або напруга)</li><li>I2C</li><li>SPI</li><li>3.3В АЦП вхід</li><li>Внутрішній порт microUSB і розширення зовнішнього порту microUSB</li></ul></li></ul><h2 id="розпіновки-та-схеми" tabindex="-1">Розпіновки та схеми <a class="header-anchor" href="#розпіновки-та-схеми" aria-label="Permalink to &quot;Розпіновки та схеми&quot;">​</a></h2><p>Схеми плат та іншу документацію можна знайти тут: <a href="https://github.com/proficnc/The-Cube" target="_blank" rel="noreferrer">Проект Cube</a>.</p><h2 id="порти" tabindex="-1">Порти <a class="header-anchor" href="#порти" aria-label="Permalink to &quot;Порти&quot;">​</a></h2><h3 id="верхня-частина-gps-telem-тощо" tabindex="-1">Верхня частина (GPS, TELEM тощо) <a class="header-anchor" href="#верхня-частина-gps-telem-тощо" aria-label="Permalink to &quot;Верхня частина (GPS, TELEM тощо)&quot;">​</a></h3><p><img src="'+e+'" alt="Cube Ports - Top (GPS, TELEM etc) і Main/AUX"></p><h2 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART2</td><td>/dev/ttyS0</td><td>TELEM1 (контроль потоку)</td></tr><tr><td>USART3</td><td>/dev/ttyS1</td><td>TELEM2 (контроль потоку)</td></tr><tr><td>UART4</td><td>/dev/ttyS2</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS3</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS4</td><td>CONSOLE/ADSB-IN</td></tr><tr><td>UART8</td><td>/dev/ttyS5</td><td>GPS2</td></tr></tbody></table><h3 id="відладочні-порти" tabindex="-1">Відладочні порти <a class="header-anchor" href="#відладочні-порти" aria-label="Permalink to &quot;Відладочні порти&quot;">​</a></h3><p><img src="'+r+'" alt="Порти відладки Cube"></p><h3 id="порти-usb-sdcard" tabindex="-1">Порти USB/SDCard <a class="header-anchor" href="#порти-usb-sdcard" aria-label="Permalink to &quot;Порти USB/SDCard&quot;">​</a></h3><p><img src="'+l+'" alt="Cube USB/SDCard порти"></p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Вона попередньо зібрана і автоматично встановлюється за допомогою <em>QGroundControl</em> при підключенні відповідного обладнання.</p></div><p>Щоб <a href="./../dev_setup/building_px4.html"> зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make cubepilot_cubeyellow</span></span></code></pre></div><h2 id="проблеми" tabindex="-1">Проблеми <a class="header-anchor" href="#проблеми" aria-label="Permalink to &quot;Проблеми&quot;">​</a></h2><p>Розташування символів CAN1 і CAN2 на кубі перевернуте (CAN1 - це CAN2 і навпаки).</p><h2 id="додаткова-інформація-документація" tabindex="-1">Додаткова інформація/документація <a class="header-anchor" href="#додаткова-інформація-документація" aria-label="Permalink to &quot;Додаткова інформація/документація&quot;">​</a></h2><ul><li><a href="./../assembly/quick_start_cube.html">Cube Wiring Quickstart</a></li><li>Cube Docs (виробник): <ul><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Огляд модуля Cube</a></li><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-user-manual" target="_blank" rel="noreferrer">Посібник користувача Cube</a></li><li><a href="https://docs.cubepilot.org/user-guides/carrier-boards/mini-carrier-board" target="_blank" rel="noreferrer">Mini Carrier Board</a></li></ul></li></ul>',35),d=[n];function c(h,b,p,g,m,_){return o(),a("div",null,d)}const P=i(u,[["render",c]]);export{M as __pageData,P as default};
